import { useState, useEffect } from "react";

import { Container } from "./styles";

import api from '../../Services/api'

interface IDisciplinas{
  disciplina: string;
  cargahoraria: number;
  professor: string;
}

export function DisciplinasTable() {
  const [faculdade, setFaculdade] = useState<IDisciplinas[]>([])

  useEffect(() =>{
    api.get('faculdade')
      .then(response => setFaculdade(response.data))
  }, [faculdade] )

  return (
    <Container>
      <table>
        <thead>
          <tr>
            <th>Disciplinas</th>
            <th>Carga Hor√°ria</th>
            <th>Professor</th>
            <th></th>
          </tr>
        </thead>

        <tbody>

            {faculdade.map(facul => (
              <tr>
                <td>{facul.disciplina}</td>
                <td>{facul.cargahoraria}</td>
                <td>{facul.professor}</td>
                <td></td>
              </tr>
            ))}
        </tbody>

      </table>
    </Container>
  )
}
